import React from "react";
import web from "../src/images/Shoot.svg";
import Commom from "./Commom";

const About = () => {
  return (
    <>
      <Commom
        name=" Fashion Expert brings Photoshoot. "
        imgsrc={web}
        visit="/contact"
        btname="Contact Now"
      />
    </>
  );
};

export default About;
